input[type="text"] {
  width: 100%;
  padding: 10px;
  border: 1px solid #ccc;
  border-radius: 4px;
  box-sizing: border-box;
  margin-bottom: 10px;
}
.dropdown {
  border: 1px solid #ccc;
  border-radius: 4px;
  max-height: 200px;
  overflow-y: auto;
}
.dropdown-item {
  padding: 10px;
  cursor: pointer;
}
.dropdown-item:hover {
  background-color: #f5f5f5;
}
.dropdown-item.selected {
  background-color: #337ab7;
  color: white;
}
.selected-items-container {
  margin-bottom: 10px;
}
.selected-item {
  display: inline-block;
  background-color: #337ab7;
  color: white;
  padding: 5px 10px;
  border-radius: 4px;
  margin-right: 5px;
  margin-bottom: 5px;
}
.remove-item {
  margin-left: 5px;
  cursor: pointer;
}
